(11, 'Casco Integral \"Titanium\"', 'Casco integral de última generación con carcasa de fibra de carbono para una máxima protección y comodidad. Con sistema de ventilación ajustable y visor antirrayaduras.', 149.99, 30, 'data:image/jpeg;base64,', 'Cascos', '2024-06-05 15:17:00', '2024-06-05 15:17:00'),
(12, 'Casco Abierto \"Retro Rider\"', 'Casco abierto estilo retro con diseño clásico y acabado de alta calidad. Con forro interior extraíble y lavable para mayor comodidad y ajuste.', 79.99, 202, 'data:image/jpeg;base64,', 'Cascos', '2024-06-05 15:17:56', '2024-06-08 09:18:33'),
(13, 'Pegatinas Reflectantes Personalizadas', 'Pegatinas reflectantes personalizadas para cascos, bicicletas, motocicletas y más. Disponible en varios tamaños y formas. Personaliza tu equipo y aumenta la visibilidad en la carretera.', 9.99, 100, 'data:image/jpeg;base64,', 'Personalizacion', '2024-06-05 15:23:54', '2024-06-05 15:23:54');
INSERT INTO `productos` (`id`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `categoria`, `created_at`, `updated_at`) VALUES
(14, 'Funda Personalizada para Casco', ': Funda protectora personalizada para cascos de motocicleta y bicicleta. Fabricada en material resistente al agua y con interior suave para proteger tu casco de arañazos y golpes.', 19.99, 50, 'data:image/jpeg;base64,', 'Personalizacion', '2024-06-05 15:28:50', '2024-06-05 15:28:50');
INSERT INTO `productos` (`id`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `categoria`, `created_at`, `updated_at`) VALUES
(15, 'Kit de Pintura en Aerosol Personalizado', 'Kit de pintura en aerosol personalizado para dar un nuevo aspecto a tu casco, bicicleta o equipo deportivo. Disponible en una amplia gama de colores y acabados.', 29.99, 17, 'data:image/png;base64,', 'Personalizacion', '2024-06-05 15:29:28', '2024-06-05 15:29:28');
INSERT INTO `productos` (`id`, `nombre`, `descripcion`, `precio`, `stock`, `imagen`, `categoria`, `created_at`, `updated_at`) VALUES
(16, 'Llavero Personalizado con Nombre', 'Llavero de cuero genuino con placa metálica grabada con tu nombre o mensaje personalizado. Disponible en varios colores y estilos. El regalo perfecto para cualquier ocasión.', 14.99, 80, 'data:image/png;base64,', 'Personalizacion', '2024-06-05 15:30:25', '2024-06-05 15:30:25'),
(17, 'Juego de Destornilladores Profesionales', 'Juego de destornilladores de precisión con mangos ergonómicos y puntas de acero endurecido. Incluye una variedad de tamaños y cabezales para trabajos de reparación y montaje.', 24.99, 50, 'data:image/jpeg;base64,', 'Herramientas', '2024-06-05 15:32:45', '2024-06-05 15:32:45'),
(18, 'Set de Llaves Allen de Precisión', 'Set de llaves Allen de precisión fabricadas en acero cromo vanadio para una máxima resistencia y durabilidad. Incluye un estuche organizador para un fácil almacenamiento y transporte.', 12.99, 100, 'data:image/jpeg;base64,', 'Herramientas', '2024-06-05 15:34:32', '2024-06-05 15:34:32'),
(19, 'Compresor de Aire Portátil para Moto', 'Compresor de aire compacto y portátil diseñado específicamente para inflar los neumáticos de la motocicleta. Conexión directa a la batería de la moto para un fácil uso en carretera. Incluye medidor de presión de neumáticos integrado.', 20.00, 30, 'data:image/jpeg;base64,', 'Herramientas', '2024-06-05 15:37:14', '2024-06-05 15:37:14'),
(20, 'Nuevo casco Negro', 'aguanta rayaduras largas', 400.00, 10, 'data:image/jpeg;base64,', 'Herramientas', '2024-06-06 07:31:42', '2024-06-06 07:33:02');

