INSERT INTO `publicacions` (`id`, `id_usuario`, `id_producto`, `Descripcion`, `imagen`, `created_at`, `updated_at`) VALUES
(40, 24, 10, '\"¡Amigos! ¡Estoy emocionado de compartir con ustedes mi última adquisición: Un compresor de aire que está cambiando por completo mi forma de trabajar! Compacto, potente y fácil de usar, este compresor es justo lo que necesitaba para mis proyectos en casa. ¡No puedo esperar para ponerlo en acción y ver lo que puedo lograr con él! 💪✨ #Herramientas #NuevoCompresor\"', 'data:image/jpeg;base64,', '2024-06-05 17:24:20', '2024-06-08 14:07:27'),
(44, 22, 11, 'Hola a todos los amantes de las motos! Les presento mi nuevo compañero de aventuras: ¡El casco Titanium! Con un diseño innovador y una construcción robusta, este casco no solo me brinda la máxima protección en mis viajes, sino que también se ve increíblemente genial. ¡Preparado para vivir emocionantes experiencias en la carretera con estilo y seguridad! 🏍️🔥 #NuevoCasco #AventurasEnMoto #Titanium', 'data:image/jpeg;base64,', '2024-06-05 17:33:45', '2024-06-08 14:07:49');
INSERT INTO `publicacions` (`id`, `id_usuario`, `id_producto`, `Descripcion`, `imagen`, `created_at`, `updated_at`) VALUES
(47, 23, 15, '¡Hola a todos! ¡Estoy emocionado de compartir con ustedes mi último descubrimiento: el spray pintura! Con su versatilidad y eficacia, este spray se ha convertido en mi herramienta imprescindible para resolver todo tipo de problemas en mi moto.  ¡este spray lo hace todo! ¡No puedo creer lo útil que es! 💪🔧 #SprayMultiusos #SoluciónRápida #MotoBienMantenida', 'data:image/jpeg;base64,', '2024-06-05 17:46:56', '2024-06-08 14:20:19'),
(49, 24, 11, 'Quería compartir con ustedes mi nueva adquisición: ¡un casco LS2 que me tiene emocionado! Con un diseño aerodinámico y una comodidad incomparable, este casco es más que solo una protección: es una declaración de estilo en la carretera. ¡Listo para disfrutar de cada viaje con seguridad y estilo! 🏍️💨 #LS2 #CascoDeMoto', 'data:image/jpeg;base64,', '2024-06-09 15:12:50', '2024-06-09 15:13:29');

